rading on some commodity. What is Adani Enterprises into?'),('Transport & Logistics','Aegis logistics','AEGISCHEM','1','Aegis logistics (auto gas) : Liquid transportation : Oil, Gas, Chemicals etc'),('Transport & Logistics','Allcargo Logistics','ALLCARGO','1','Allcargo Logistics (Ship, Ton load, Vessel etc)'),('Transport & Logistics','Container Corporation','CONCOR','1','Container Corporation - CPSE NAVARATNA (Railway Cargo on Indian Railways) : 68 ICD (Inland Container Depot) / CFS (Container freight station)'),('Transport & Logistics','Future Supply Chain','FSC','1','Future Supply Chain (FSC) : retail transportation'),('Transport & Logistics','Interglobe Aviation','INDIGO','1','Interglobe Aviation (Operator of Indigo)'),('Transport & Logistics','Mahindra Logistics','MAHLOG','1','Mahindra Logistics : auto transportation & 3PL (third party logistics)'),('Transport & Logistics','VRL Logistics','VRLLOG','1','VRL Logistics (India\'s largest fleet owner for transportation. Vijay Anand Road Lines from a humble beginning as a truck driver.) : Mainly cargo on road.'),('Transport & Logistics','none','','0','Shipping, Courier, Transport & Logistics is a same business.'),('Tyres','Apollo Tyres','APOLLOTYRE','1','Apollo Tyres (Go the Distance, Second biggest versatile player) - In Worlds\' top 20 players.'),('Tyres','Balkrishna Industries','BALKRISIND','1','Balkrishna Industries focuses on off the road (BKT Tyres : leader in off-the-road tyres)'),('Tyres','CEAT ','CEATLTD','1','CEAT (flagship company of RPG : R P Goenka : Group company)'),('Tyres','Goodyear ','GOODYEAR','1','Goodyear (USA)'),('Tyres','JK Tyre ','JKTYRE','1','J K Tyre (Lala Jugilal Singhania and Lala Kamalpat Singhania). The same group has other companies like J K Paper and J K Lakshmi Cement etc.'),('Tyres','MRF','MRF','1','MRF (Tyres - Leader in India, FunSkool - toys, preschool stuff, tie-up with all tops brands like HASBRO, LEGO, Disney etc, In toys space - Piaramal Enterprises\'s Little is a listed competi